using Xunit;
using ResembleNet;
using System.Drawing;
using System;
using ResembleNet.Utils;

namespace Tests
{
    public class CommonTests
    {
        [Fact]
        public void CompareGhosts()
        {
            var peopleSrc = Image.FromFile(@".\Examples\ghost1.png");
            var people2Src = Image.FromFile(@".\Examples\ghost2.png");

            var result = new Resemble(peopleSrc)
                .CompareTo(people2Src)
                .Compare();

            Assert.Equal(138, result.DiffBounds.Bottom);
            Assert.Equal(90, result.DiffBounds.Left);
            Assert.Equal(157, result.DiffBounds.Right);
            Assert.Equal(107, result.DiffBounds.Top);

            Assert.Equal(0, result.DimensionDifference.Height);
            Assert.Equal(0, result.DimensionDifference.Width);
            Assert.True(result.IsSameDimensions);

            Assert.Equal("0.27", result.Mismatch.ToString("F2"));
        }

        [Fact]
        public void ShouldReturnEarlyIfMeetTreshold()
        {
            var people = Image.FromFile(@".\Examples\text.png");
            var people2 = Image.FromFile(@".\Examples\textAa.png");

            var result = new Resemble(people)
                .CompareTo(people2)
                .SetReturnEarlyThreshold(2)
                .Compare();

            Assert.Equal("2.00", result.Mismatch.ToString("F2"));
        }

        [Fact]
        public void TransparencyShouldBeRespected()
        {
            var actualImage = Image.FromFile(@".\Examples\People.jpg");
            var baseline = Image.FromFile(@".\Examples\People2.jpg");

            var result = new Resemble(actualImage)
                .CompareTo(baseline)
                .WithResultTransparency(0.3f)
                .Compare();

            var expectedResult = Convert.FromBase64String(@"");
            var actualResult = Convert.FromBase64String(result.ImageDifference);

            Assert.Equal("8.66", result.Mismatch.ToString("F2"));
            Assert.Equal(expectedResult, actualResult);
        }

        [Fact]
        public void ActualImageShouldBeResized()
        {
            var sampleImage = Image.FromFile(@".\Examples\People.jpg");
            var resizer = new DefaultImageResizer();
            var scaledImage = resizer.Resize(sampleImage, sampleImage.Width * 2, sampleImage.Height * 2);

            var result = new Resemble(scaledImage)
                .CompareTo(sampleImage)
                .ScaleToBaselineSize(resizer)
                .IgnoreAntialiasing()
                .Compare();

            Assert.Equal(0, result.DiffBounds.Bottom);
            Assert.Equal(500, result.DiffBounds.Left);
            Assert.Equal(0, result.DiffBounds.Right);
            Assert.Equal(500, result.DiffBounds.Top);

            Assert.Equal(0, result.DimensionDifference.Height);
            Assert.Equal(0, result.DimensionDifference.Width);
            Assert.True(result.IsSameDimensions);

            Assert.Equal("0.00", result.Mismatch.ToString("F2"));
        }

        [Theory]
        [InlineData(0.01)]
        [InlineData(1.00001)]
        public void SetTransparencyShouldThrowException(float transparency)
        {
            var result = new Resemble(new Bitmap(1, 1));

            Assert.Throws<ArgumentOutOfRangeException>(() => result.WithResultTransparency(transparency));
        }

        [Fact]
        public void ExceptionShouldBeThrown_WhenActualImageIsNotSpecified()
        {
            Assert.Throws<ArgumentNullException>(() => new Resemble(null));
        }

        [Fact]
        public void ExceptionShouldBeThrown_WhenBaselineImageWasSetAsNull()
        {
            Assert.Throws<ArgumentNullException>(() => new Resemble(new Bitmap(1, 1)).CompareTo(null));
        }

        [Fact]
        public void ExceptionShouldBeThrown_WhenBaselineImageWasNotSet()
        {
            Assert.Throws<ArgumentNullException>(() => new Resemble(new Bitmap(1, 1)).Compare());
        }
    }
}
